import React from "react";
import "../Principal.css";

export default function Principal() {
 const funcionarios = [
    "Funcionario 1",
    "Funcionario 2",
    "Funcionario 3",
    "Funcionario 4",
    "Funcionario 5",
    "Funcionario 6",
    "Funcionario 7",
    "Funcionario 8",
  ];

  return (
    <div className="vista1-container">
      <header className="banner">
        <div className="logo-container">
          <img src="/image.png" alt="logo" className="logo" />
          <h1 className="titulo">Portal ELEAM</h1>
        </div>
      </header>

      <h2 className="subtitulo">Personal de turno:</h2>

      {/* Grid 4x2 */}
      <div className="grid-funcionarios">
        {funcionarios.map((nombre, i) => (
          <div key={i} className="funcionario-card">
            <img src="/funcionario.png" alt={nombre} className="foto-funcionario" />
            <p>{nombre}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
